import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';

export const MenuNav = () => {
  return (
    <Navbar expand="lg" className='bg-body-tertiary' style={{marginLeft: "40px"}}>
      <Container style={{marginLeft: "1%", marginTop: "100px"}}>
        <Navbar.Brand href='/' aria-label='Nombre'>Web Apuntes</Navbar.Brand>
        <Navbar.Toggle aria-controls='basic-navbar-nav' />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className='me-auto'>
            <Nav.Link href='/' aria-label='Inicio'>Inicio</Nav.Link>
            <Nav.Link href='/perfil' aria-label='Perfil'>Perfil</Nav.Link>
            <Nav.Link href='/contacto' aria-label='Contact'>Contacto</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  )
}
